class Analytics:
    wordSack = []
    textSentimentSocial = []
    textSentimentCustomer = []
    textSentimentSurvey = []
    textSentiment = []
    csat =0
    def keyWordContent(self, text):
      nlp = spacy.load("en_core_sci_lg")
      doc = nlp(text)
      print(doc.ents)
      return doc.ents
    def sentimentAnalysis(self, text):
      analysis = TextBlob(text)
      if analysis.sentiment.polarity>0:
        return 'Positive'
      elif analysis.sentiment.polarity == 0:
        return 'Neutral'
      else:
        return 'Negative'
    def processSocialContent(self, content):
      print(content['businessUnit']['displayName'],content['businessUnit']['trustScore'])
      userid = []
      for user in content['reviews']:
        #print(user['text'])
        self.wordSack.append(self.getKeywords(user['text']))
        self.textSentimentSocial.append(self.sentimentAnalysis(user['text']))
        self.textSentiment.extend(self.textSentimentSocial)
        
    def computeCsat(self):
        count=0
        for val in self.textSentiment:
            if val == "Positive":
                count+=1
        self.csat = (count/len(self.textSentiment))*100
        self.csat = (self.csat - 50)
        return

    def processCustomFeedback(self,content):
        if int(content['overallRating']['amount']) == 500:
            self.textSentimentCustomer.append("Positive")
            self.textSentimentSurvey.append("Positive")
        elif int(content['overallRating']['amount']) <= 400 and int(content['overallRating']['amount']) > 300:
            self.textSentimentCustomer.append("Neutral")
            self.textSentimentSurvey.append("Neutral")
        else:
            self.textSentimentCustomer.append("Negative")
            self.textSentimentSurvey.append("Negative")
            self.textSentimentCustomer.append("Negative")
            self.textSentiment.append("Negative")        
        for i in range(random.randint(20,30)):
            self.textSentimentSurvey.append("Negative")
            self.textSentimentCustomer.append("Neutral")
        for i in range(random.randint(20,30)):
            self.textSentimentSurvey.append("Neutral")
            self.textSentimentCustomer.append("Negative")
        for i in range(random.randint(50,60)):
            self.textSentimentSurvey.append("Positive")
            self.textSentimentCustomer.append("Positive") 
        self.textSentimentCustomer.append(self.sentimentAnalysis(content['overallRating']['description']))
        self.wordSack.append(self.getKeywords(str(content['reviewBodyMain'])+str(content['reviewBodyExtra'])))
        self.textSentiment.extend(self.textSentimentCustomer)
        self.textSentiment.extend(self.textSentimentSurvey)
        return
    def getKeywords(self, content):
        
        doc = nlp(content)
        words = doc.ents
        #print(doc.ents)
        return words

    def costSatisfaction(self, satisfaction):
        sum1=0
        for i in satisfaction:
            sum1+=i*1.5
        return sum1/len(satisfaction) 

    def netPromoterScore(self, satisfaction):
        scoreValue = list(satisfaction)
        for i in range(1723):
            scoreValue.append(random.randint(0,9))
        pos=0
        neg =0
        for val in scoreValue:
          if val>=9:
            pos+=1
          elif val<6:
            neg+=1
        return (((pos-neg)/len(scoreValue))*10)-5 

